-- ----------------------------
-- Table structure for account
-- ----------------------------
DROP TABLE IF EXISTS `account`;
CREATE TABLE `account` (
  `uuid` varchar(32) NOT NULL COMMENT '主键UUID',
  `username` varchar(32) DEFAULT NULL COMMENT '用户名',
  `password` varchar(32) DEFAULT NULL COMMENT '密码',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `is_del` int NOT NULL DEFAULT '0' COMMENT '是否删除',
  `isDisable` int NOT NULL DEFAULT '0' COMMENT '账号状态。0正常，1禁用，2锁定，3注销',
  `errCount` int NOT NULL DEFAULT '0' COMMENT '密码输入错误次数',
  `usedPwd` varchar(255) NOT NULL COMMENT '过去五次使用过的密码',
  `lastUpdateTime` datetime DEFAULT NULL COMMENT '最后更新密码时间',
  `lockTime` datetime DEFAULT NULL COMMENT '账号锁定时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- ----------------------------
-- Records of account
-- ----------------------------

-- ----------------------------
-- Table structure for account_info
-- ----------------------------
DROP TABLE IF EXISTS `account_info`;
CREATE TABLE `account_info` (
  `uuid` varchar(32) NOT NULL COMMENT '主键UUID',
  `username` varchar(32) NOT NULL COMMENT '账号名',
  `nickName` varchar(32) DEFAULT NULL COMMENT '别名',
  `name` varchar(32) NOT NULL COMMENT '姓名',
  `sex` char(1) DEFAULT '0' COMMENT '性别（0为未知，1为男，2为女）',
  `mobile` varchar(11) DEFAULT NULL COMMENT '手机号',
  `email` varchar(32) DEFAULT NULL COMMENT '邮箱地址',
  `auth_name` char(1) DEFAULT '2' COMMENT '0 超级管理员 1 管理员 2 成员',
  `auth_range` varchar(128) DEFAULT NULL COMMENT '权限范围,以逗号分隔',
  `avatar` varchar(128) DEFAULT NULL COMMENT '头像url',
  `is_del` char(1) DEFAULT '0' COMMENT '删除标识（0表示未删除，1表示删除）',
  `level` char(2) DEFAULT '0' COMMENT '用户等级',
  `job` varchar(32) DEFAULT NULL COMMENT '职位',
  `introduction_of_author` varchar(256) DEFAULT NULL COMMENT '作者简介',
  `create_time` datetime DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  PRIMARY KEY (`uuid`)
